import React from "react";
import "./Landing.css";
import Button from "../../components/Button";
import hero from "../../assets/images/hero.png";

function Landing(){
    return(
        <div className="landing">
            <div className="container-1">
                <h1>edbroader</h1>
                <img src={hero} alt="hero"/>
            </div>
            <div className="container-2">
                <h3><strong>Be ready to go global</strong></h3>
                <h4>Explore the best countries, schools and programs for your education with edbroader.</h4>
                <Button type="button" className="signupBtn" name="gotoSignup" label="Get started"/>
            </div>
        </div>
    )
}
export default Landing;
